    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1646791212406,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1646791748506,"commentText":"<div>This playback covers the aggregate operators <font face=\"Courier\">COUNT</font>, <font face=\"Courier\">MIN</font>, <font face=\"Courier\">MAX</font>, <font face=\"Courier\">AVG</font>, and <font face=\"Courier\">SUM</font>. These work on groups of rows instead of individual rows.</div><div><br></div><div>I also cover <font face=\"Courier\">GROUP BY</font> which allows you to specify which rows to add to a group. Next, I cover the <font face=\"Courier\">HAVING</font> keyword to specify a selection condition on groups rather that individual rows.<br></div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-38":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-38","timestamp":1646791248834,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":38,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-37","lineNumber":2,"column":10,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646877800491,"commentText":"<div>The <font face=\"Courier\">COUNT</font> operator returns the number of rows that are returned from a query. It can be projected out with <font face=\"Courier\">SELECT</font>. <br></div><div><br></div><div>It is common to give the derived data a name with <font face=\"Courier\">AS</font>. Here I am calling the count, <font face=\"Courier\">numDogs</font>, since the count shows the total number of dogs. <br></div><div><br></div><div>Most of the aggregate operators require that you specify an attribute to act on. <font face=\"Courier\">COUNT</font> doesn't need an attribute name so the parentheses and star <font face=\"Courier\">(*)</font> are used instead.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"COUNT(*) AS numDogs","startRow":0,"startColumn":7,"endRow":0,"endColumn":26}],"imageURLs":["media/images/1646792115903-Screen Shot 2022-03-08 at 3.24.41 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT COUNT(*) AS numDogs\nFROM Dogs;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-75":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-75","timestamp":1646791260707,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":75,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-74","lineNumber":1,"column":25,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646877827477,"commentText":"<div>The aggregate operator <font face=\"Courier\">AVG</font> will find the average of all the values associated with an attribute. <br></div><div><br></div><div>In this case, I specify that I want the average of all the <font face=\"Courier\">age</font> values in the query results. This is the average age of all of the dogs.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"AVG(age) AS avgAge","startRow":0,"startColumn":7,"endRow":0,"endColumn":25}],"imageURLs":["media/images/1646794099741-Screen Shot 2022-03-08 at 3.25.10 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT AVG(age) AS avgAge\nFROM Dogs;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-116":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-116","timestamp":1646791270858,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":116,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-115","lineNumber":1,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646794235251,"commentText":"<div><font face=\"Courier\">MIN</font> returns the smallest value of the specified attribute.</div><div><br></div><div>Here I am finding the age of the youngest dog.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"MIN(age) AS youngestAge","startRow":0,"startColumn":7,"endRow":0,"endColumn":30}],"imageURLs":["media/images/1646794229178-Screen Shot 2022-03-08 at 3.25.35 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT MIN(age) AS youngestAge\nFROM Dogs;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-160":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-160","timestamp":1646791281444,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":160,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-159","lineNumber":1,"column":28,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646794302840,"commentText":"<div>There is a similar <font face=\"Courier\">MAX</font> operator that returns the largest value for the specified attribute. <br></div><div><br></div><div>Here I am finding the age of the oldest dog in the database.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"MAX(age) AS oldestAge","startRow":0,"startColumn":7,"endRow":0,"endColumn":28}],"imageURLs":["media/images/1646794298020-Screen Shot 2022-03-08 at 3.26.08 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT MAX(age) AS oldestAge\nFROM Dogs;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-252":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-252","timestamp":1646791293069,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":252,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-251","lineNumber":2,"column":15,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646877898412,"commentText":"<div>The <font face=\"Courier\">SUM</font> operator will calculate a running sum of a specified attribute.</div><div><br></div><div>Each location has a capacity to hold a certain number of dogs. This query will return the total capacity to hold dogs in all of the locations.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"SUM(capacity) AS totalCapacity","startRow":0,"startColumn":7,"endRow":0,"endColumn":37}],"imageURLs":["media/images/1646794407778-Screen Shot 2022-03-08 at 4.05.10 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT SUM(capacity) AS totalCapacity\nFROM Locations;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-339":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-339","timestamp":1646791310068,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":339,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-338","lineNumber":3,"column":15,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646794713751,"commentText":"<div>In the playback describing <font face=\"Courier\">ORDER BY</font> I said that you can sort the query results on one or more attributes. In this query I am displaying all of the dogs and sorting them by the breed of the dog.</div><div><br></div><div>The attached screenshot shows the results. I have marked up the screenshot to show how many dogs there are of each breed.</div><div><br></div><div>If you think of each set of rows split by breed as a 'group' then there are some operations that can be performed on the whole group (counting, minimum, maximum, average, and sum). This is exactly what <font face=\"Courier\">GROUP BY</font> is used for.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ORDER BY breed","startRow":2,"startColumn":0,"endRow":2,"endColumn":14}],"imageURLs":["media/images/1646794625370-Screen Shot 2022-03-08 at 3.27.10 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT *\nFROM Dogs\nORDER BY breed;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-376":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-376","timestamp":1646791327754,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":376,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-375","lineNumber":1,"column":33,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646877964442,"commentText":"Here I chang the <font face=\"Courier\">ORDER BY</font> to a <font face=\"Courier\">GROUP BY</font>. This causes all of the rows that have the same breed to be put into a group- the boxer group, the greyhound group, and so on.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"GROUP BY breed","startRow":2,"startColumn":0,"endRow":2,"endColumn":14}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, COUNT(*) AS numDogs\nFROM Dogs\nGROUP BY breed;","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-8","displayCommentEvent":{"id":"ev-376","timestamp":1646791327754,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":376,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-375","lineNumber":1,"column":33,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646794889044,"commentText":"Here I project out the <font face=\"Courier\">breed</font> and a count of how many rows are in the group. This has the effect of counting how many dogs are of each breed. The attached screenshot shows the results.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"breed, COUNT(*) AS numDogs","startRow":0,"startColumn":7,"endRow":0,"endColumn":33}],"imageURLs":["media/images/1646794845296-Screen Shot 2022-03-08 at 3.29.04 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, COUNT(*) AS numDogs\nFROM Dogs\nGROUP BY breed;","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-9","displayCommentEvent":{"id":"ev-376","timestamp":1646791327754,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":376,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-375","lineNumber":1,"column":33,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646878031686,"commentText":"<div>There is one limitation of using <font face=\"Courier\">GROUP BY</font>. You are limited in what can be projected out with <font face=\"Courier\">SELECT</font>.<br></div><div><br></div><div>The only attribute value that all of the rows in the group are guaranteed to have in common is the <font face=\"Courier\">breed</font>. So, it is the only attribute (other than the aggregate operators) that can be specified in the <font face=\"Courier\">SELECT</font>.</div><div><br></div><div>I can't display the <font face=\"Courier\">name</font> attribute, for example, because the dogs in the different groups all have different names. I can only project out the <font face=\"Courier\">breed</font> since I know every row in each group has the same value for that attribute.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"breed","startRow":0,"startColumn":7,"endRow":0,"endColumn":12},{"fileId":"fileId-0","selectedText":"breed","startRow":2,"startColumn":9,"endRow":2,"endColumn":14}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, COUNT(*) AS numDogs\nFROM Dogs\nGROUP BY breed;","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-413":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-413","timestamp":1646791343390,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":413,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-412","lineNumber":1,"column":32,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646795636891,"commentText":"<div>I can use any of the aggregate operators in the <font face=\"Courier\">SELECT</font> to display different characteristics of the group.</div><div><br></div><div>Here I am displaying the average age of the dogs of the different breeds.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"AVG(age) AS avgAge","startRow":0,"startColumn":14,"endRow":0,"endColumn":32}],"imageURLs":["media/images/1646795632443-Screen Shot 2022-03-08 at 3.29.36 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, AVG(age) AS avgAge\nFROM Dogs\nGROUP BY breed;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-510":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-510","timestamp":1646791359030,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":510,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-509","lineNumber":3,"column":20,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646796062350,"commentText":"<div>When I was discussing <font face=\"Courier\">ORDER BY</font> I said that you can sort by multiple attributes. The second attribute is used when there are multiple identical values for the first sort attribute. <br></div><div><br></div><div>In the highlighted query, for example, all of the dogs of the same breed are sorted by age.<br></div><div><br></div><div>You think of each attribute in a <font face=\"Courier\">GROUP BY</font> as creating a way to split the rows into new groups. Next, I'll find groups based on the <font face=\"Courier\">breed</font> and the <font face=\"Courier\">age</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ORDER BY breed, age","startRow":2,"startColumn":0,"endRow":2,"endColumn":19}],"imageURLs":["media/images/1646795888252-Screen Shot 2022-03-08 at 3.30.10 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT *\nFROM Dogs\nORDER BY breed, age;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-552":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-552","timestamp":1646791381042,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":552,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-551","lineNumber":1,"column":38,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646796227352,"commentText":"<div>Here I <font face=\"Courier\">GROUP BY</font> the <font face=\"Courier\">breed</font> and the <font face=\"Courier\">age</font> and then display a count of how many rows are in each group (see the attached screenshot).</div><div><br></div><div>You can see that there are two groups that have more than one dog in them (two year old labs and five year old mixed breed dogs).<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"breed, age, COUNT(*) AS numDogs","startRow":0,"startColumn":7,"endRow":0,"endColumn":38},{"fileId":"fileId-0","selectedText":"GROUP BY breed, age","startRow":2,"startColumn":0,"endRow":2,"endColumn":19}],"imageURLs":["media/images/1646796151300-Screen Shot 2022-03-08 at 3.30.49 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, age, COUNT(*) AS numDogs\nFROM Dogs\nGROUP BY breed, age;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-572":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-572","timestamp":1646791403912,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":572,"type":"INSERT","fileId":"fileId-0","character":"1","previousNeighborId":"ev-571","lineNumber":4,"column":19,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646878188515,"commentText":"<div>The <font face=\"Courier\">HAVING</font> keyword allows you to specify a selection condition that must be true of the entire group in order for it to become part of the results.</div><div><br></div><div>Here I am only interested in seeing groups where the row count is greater than one. The attached screenshot shows the two groups where there are two or more dogs in each group.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"HAVING COUNT(*) > 1","startRow":3,"startColumn":0,"endRow":3,"endColumn":19}],"imageURLs":["media/images/1646796345172-Screen Shot 2022-03-08 at 3.31.37 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"0","currentFilePath":"/groupBy.sql","viewableBlogText":"SELECT breed, age, COUNT(*) AS numDogs\nFROM Dogs\nGROUP BY breed, age\nHAVING COUNT(*) > 1;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
